Ext.define('AM.view.MyToolbar29', {
  extend: 'Ext.toolbar.Toolbar',

  initComponent: function() {
    var me = this;

    Ext.applyIf(me, {
      items: [
        {
          xtype: 'tbfill'
        },
        {
          xtype: 'button',
          handler: function(button, event) {
            me.onSave();
          },
          text: 'Ok'
        },
        {
          xtype: 'button',
          handler: function(button, event) {
            me.onReset();
          },
          text: 'Cancel'
        }
      ]
    });

    me.callParent(arguments);
  }

});